// 파일: EditPage.js
import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
import { Button } from 'react-bootstrap';

const EditPage = () => {
  const { id } = useParams(); // URL에서 id 가져오기
  const [parcel, setParcel] = useState(null);
  const [updatedParcel, setUpdatedParcel] = useState({
    tracking_number: '',
    sender_name: '',
    recipient_name: '',
    recipient_address: '',
    status: '',
    cost: ''
  });

  useEffect(() => {
    // 해당 id로 Parcel 정보 가져오기
    const fetchParcel = async () => {
      try {
        const response = await axios.get(`https://67296bac6d5fa4901b6d14a6.mockapi.io/oss4-2/parcels/${id}`);
        setParcel(response.data);
        setUpdatedParcel(response.data); // 초기값 설정
      } catch (error) {
        console.error('Error fetching parcel details:', error);
      }
    };

    fetchParcel();
  }, [id]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setUpdatedParcel({ ...updatedParcel, [name]: value });
  };

  const saveChanges = async () => {
    try {
      await axios.put(`https://67296bac6d5fa4901b6d14a6.mockapi.io/oss4-2/parcels/${id}`, updatedParcel);
      alert('수정이 완료되었습니다.');
      window.history.back(); // 저장 후 이전 페이지로 이동
    } catch (error) {
      console.error('Error saving changes:', error);
      alert('수정에 실패했습니다.');
    }
  };

  if (!parcel) {
    return <p>Loading...</p>;
  }

  return (
    <div className="container mt-5">
      <h2>수정하기</h2>
      <form>
        <div className="mb-3">
          <label className="form-label">운송장 번호</label>
          <input
            type="text"
            className="form-control"
            name="tracking_number"
            value={updatedParcel.tracking_number}
            onChange={handleInputChange}
          />
        </div>
        <div className="mb-3">
          <label className="form-label">보내는 사람</label>
          <input
            type="text"
            className="form-control"
            name="sender_name"
            value={updatedParcel.sender_name}
            onChange={handleInputChange}
          />
        </div>
        <div className="mb-3">
          <label className="form-label">받는 사람</label>
          <input
            type="text"
            className="form-control"
            name="recipient_name"
            value={updatedParcel.recipient_name}
            onChange={handleInputChange}
          />
        </div>
        <div className="mb-3">
          <label className="form-label">주소</label>
          <input
            type="text"
            className="form-control"
            name="recipient_address"
            value={updatedParcel.recipient_address}
            onChange={handleInputChange}
          />
        </div>
        <div className="mb-3">
          <label className="form-label">상태</label>
          <select
            className="form-select"
            name="status"
            value={updatedParcel.status}
            onChange={handleInputChange}
          >
            <option value="배송 준비">배송 준비</option>
            <option value="배송 중">배송 중</option>
            <option value="배송 완료">배송 완료</option>
            <option value="반송">반송</option>
          </select>
        </div>
        <div className="mb-3">
          <label className="form-label">비용</label>
          <input
            type="number"
            className="form-control"
            name="cost"
            value={updatedParcel.cost}
            onChange={handleInputChange}
          />
        </div>
      </form>
      <div className="mt-4">
        <Button variant="secondary" onClick={() => window.history.back()} className="me-2">
          뒤로가기
        </Button>
        <Button variant="primary" onClick={saveChanges}>
          저장
        </Button>
      </div>
    </div>
  );
};

export default EditPage;
